  <div className='card center-items'>
    <Title className='card-title' text={title} />
    <h3> {jobTitle} </h3>
    <div className='cards-links'>{links.length ? links.map((link) => <a href={link.url}>{link.name}</a>) : null}</div>

    <button>Lets talk!</button>
  </div>
);

export default Card;
